contracts/TransferContractETH.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract EtherTransfer {
    // Event to log successful transfers
    event TransferSuccessful(address indexed recipient, uint256 amount);

    // Function to transfer Ether to a specified address
    function transferEther(
        address payable recipient,
        uint256 amount
    ) public payable {
        require(
            amount <= address(this).balance,
            "Insufficient balance in the contract"
        );

        // Transfer Ether to the specified address
        (bool success, ) = recipient.call{value: amount}("");
        require(success, "Transfer failed");

        // Emit the TransferSuccessful event
        emit TransferSuccessful(recipient, amount); 
    }
}

